/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-responsive-popover", tags, suffix)} vertical-align="Top" class="ui5-side-navigation-popover"><${scopeTag("ui5-list", tags, suffix)} mode="None" @ui5-item-click="${ifDefined(context.handleListItemClick)}"><${scopeTag("ui5-li", tags, suffix)} title="${ifDefined(context._popoverContent.mainItem._tooltip)}" ?selected="${context._popoverContent.mainItemSelected}" .associatedItem="${ifDefined(context._popoverContent.mainItem)}">${ifDefined(context._popoverContent.mainItem.text)}</${scopeTag("ui5-li", tags, suffix)}>${ repeat(context._popoverContent.subItems, (item, index) => item._id || index, (item, index) => block1(item, index, context, tags, suffix)) }</${scopeTag("ui5-list", tags, suffix)}></${scopeTag("ui5-responsive-popover", tags, suffix)}>`;
const block1 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li", tags, suffix)} title="${ifDefined(item._tooltip)}" ?selected="${item.selected}" .associatedItem="${ifDefined(item)}">${ifDefined(item.text)}</${scopeTag("ui5-li", tags, suffix)}>`;


export default block0;
